description:
bán đất đấu giá cầu lọc_ngọc tảo_phúc thọ_gần kcn nam phúc thọ_200m ra đường 32 _ô tô đỗ cửa - 128m2_7,7 tỷ
bán đất đấu giá cầu lọc, ngọc tảo, phúc thọ, hà nội:
- vị trí: cách đường quốc lộ 32 và kcn nam phúc thọ 100m, cách cầu phùng 3km, tiện đi lại;
- diện tích lô đất 128 m2, mặt tiền rộng 8.5m, 2 mặt tiền, 3 mặt thoáng. đường rộng 7 m vỉa hè mỗi bên 3 m;
- hai mặt đường trước sau xây nhà cực đẹp. khu đông dân cư, điện, nước sạch đầy đủ; 
- xung quanh nhiều căn biệt thự xây mới, khang trang; 
- khu đầy đủ tiện ích, trạm y tế, trường mầm non, trường cấp 1-2-3 phúc thọ;
- gần quy hoạch khu công nghiệp nam phúc thọ, với diện tích 100 ha, sẽ kéo công nhân và các dịch vụ kèm theo; 
- thửa đất có thể xây nhà ở, xây văn phòng công ty, nhà hàng, khách sạn….. tiềm năng tăng giá lớn.
 sổ đỏ chính chủ, vuông vắn (sẵn sàng giao dịch sang tên)
      giá: 7.70 tỷ 
